webpackJsonp([0xbe13d915cba3],{3261:function(e,t){e.exports={pathContext:{docHtml:'<h1>Utility functions for working with typescript\'s AST</h1>\n<h2>Usage</h2>\n<p>This package consists of two major parts: utilities and typeguard functions.\nBy importing the project you will get both of them.</p>\n<pre><code class="language-js">import * as utils from "tsutils";\nutils.isIdentifier(node); // typeguard\nutils.getLineRanges(sourceFile); // utilities\n</code></pre>\n<p>If you don\'t need everything offered by this package, you can select what should be imported. The parts that are not imported are never read from disk and may save some startup time and reduce memory consumtion.</p>\n<p>If you only need typeguards you can explicitly import them:</p>\n<pre><code class="language-js">import { isIdentifier } from "tsutils/typeguard";\n// You can even distiguish between typeguards for nodes and types\nimport { isUnionTypeNode } from "tsutils/typeguard/node";\nimport { isUnionType } from "tsutils/typeguard/type";\n</code></pre>\n<p>If you only need the utilities you can also explicitly import them:</p>\n<pre><code class="language-js">import { forEachComment, forEachToken } from "tsutils/util";\n</code></pre>\n<h3>Typescript version dependency</h3>\n<p>This package is backwards compatible with typescript 2.1.0 at runtime although compiling might need a newer version of typescript installed.</p>\n<p>Using <code>typescript@next</code> might work, but it\'s not officially supported. If you encounter any bugs, please open an issue.</p>',docPath:"argo-ci/node_modules/tsutils/readme",proj:"argo-ci"}}}});
